import {  useState} from 'react'
import style from './Form.module.css'

const Form=(props)=>{

const[userData, setUserData]= useState({
    username: '',
    password: ''
   })

const [errors, setErrors]= useState({
    userName:'',
    password:''
})
  



const handleInputChange=(event)=>{
    setUserData({
        ...userData,  [event.target.name]:event.target.value
    }) 
    validation(event)
 }


 const validation = (event) => {
    if (!/\S+@\S+\.\S+/.test(event.target.value)) {
        errors['userName']= "el usuario tiene que ser un email"
    }
    if (!event.target.value) {
      //userName
      errors['password']= "el nombre de usuario no puede estar vacío"
    }
    if (event.target.value.length > 35) {
      //userName
      errors['userName']="el nombre de usuario no puede tener más de 35 caracteres";
    }
    if (!/\d+/.test(event.target.value)) {
        errors['password']= "la contraseña tiene que tener al menos un número."
    }
    if (event.target.value.length >= 6 && event.target.value.length <= 10) {
