   return( 
   <div className={style.divContainer}>
      {
         characters && characters.map((character=> 
         <Card name= {character.name} 
         species={character.species} 
         gender={character.gender}
         image={character.image} 
         id={character.id}
         onClose={()=>onClose(character.id)}/>
   ))
      }
   </div>)
}

